import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/HomePage.css';

function HomePage() {
    const quotes = [
      "Don't let anyone rob you of your imagination, your creativity, or your curiosity.– Mae Jemison",
      "I was taught that the way of progress was neither swift nor easy.– Marie Curie",
      "Optimism is the faith that leads to achievement. Nothing can be done without hope and confidence.– Helen Keller",
      "Success isn’t about how much money you make; it’s about the difference you make in people’s lives.– Michelle Obama",
      "Do not wait for someone else to come and speak for you. It's you who can change the world.– Malala Yousafzai"
    ];

    const randomQuote = quotes[Math.floor(Math.random() * quotes.length)];

    return (
        <div id="home-page-container">
          <header id="home-navbar">
          <Link to="/home"><img src="grow_to_impress_logo.png" alt="logo" className="logo" /></Link>

            <div className="navbar-links">
              <Link to="/how-to-section" className="nav-link">HOW TO SECTION</Link>
              <Link to="/stories" className="nav-link">STORIES OF INSPIRATION</Link>
              <Link to="/resources" className="nav-link">RESOURCES</Link>
              <Link to="/chatbot" className="nav-link">CHAT WITH US</Link>
            </div>
          </header>

          <div id="home-content-container">
            <img src="Gemini_Generated_Image_ghgrbkghgrbkghgr.jpeg" alt="rose" className="center-image" />
            <h2 className="quote">Believe in yourself and all that you are.</h2>
          </div>
        </div>
      );

}

export default HomePage;
